def parse_nested_parens(paren_string: str) -> List[int]:
    def parse_parens(s: str) -> int:
        max_depth = 0
        depth = 0
        for c in s:
            if c == '(':
                depth += 1
                if depth > max_depth:
                    max_depth = depth
            elif c == ')':
                depth -= 1
                if depth < 0:
                    raise ValueError("Mismatched parentheses")
        if depth != 0:
            raise ValueError("Mismatched parentheses")
        return max_depth

    result = []
    for s in paren_string.split():
        result.append(parse_parens(s))
    return result

