def parse_nested_parens(paren_string: str) -> List[int]:
    def helper(s, depth):
        if not s:
            return depth
        elif s[0] == '(':
            return helper(s[1:], depth + 1)
        else:
            return depth

    groups = paren_string.split()
    return [max(helper(group, 0), 1) for group in groups]

