    def count_buckets(grid, capacity):
        buckets_needed = 0
        for row in grid:
            row_capacity = 0
            for val in row:
                if val == 1:
                    row_capacity += 1
                if row_capacity == capacity:
                    buckets_needed += 1
                    row_capacity = 0
            if row_capacity > 0:
                buckets_needed += 1
        return buckets_needed

