    min_buckets = count_buckets(grid, 1)

    while min_buckets <= max_buckets:
        mid_buckets = (min_buckets + max_buckets) // 2
        if count_buckets(grid, mid_buckets) <= len(grid) * bucket_capacity:
            min_buckets = mid_buckets + 1
        else:
            max_buckets = mid_buckets - 1

    return min_buckets - 1

