def max_fill(grid, capacity):
    import math

    if not grid or not grid[0]:
        return 0

    rows, cols = len(grid), len(grid[0])
    well_capacity = capacity * cols

    def get_well_capacity(well):
        return sum(well)

    wells = [get_well_capacity(row) for row in grid]

    def get_num_buckets(capacity, wells):
        buckets = []
        for well in wells:
            num_buckets = math.ceil(well / capacity)
            buckets.append(num_buckets)
        return sum(buckets)

    num_buckets = get_num_buckets(capacity, wells)

    # If the total capacity of all wells is less than the capacity of one bucket,
    # we can't fill them all using the buckets.
    if sum(wells) < well_capacity:
        return 0

    # If the total capacity of all wells is exactly equal to the capacity of one bucket,
    # we can fill them all using the buckets with no extra trips needed.
    elif sum(wells) == well_capacity:
        return num_buckets

    # If the total capacity of all wells is greater than the capacity of one bucket,
    # we need to make extra trips to fill them all.
    else:
        extra_capacity = sum(wells) % well_capacity
        extra_trips = math.ceil(extra_capacity / capacity)
        return num_buckets + extra_trips

